#include "font.h"
#include "../uart/uart1.h"

/* Functions to display text on the screen */
// NOTE: zoom = 0 will not display the character
void drawChar(unsigned char ch, int x, int y, unsigned int attr, int zoom)
{
    unsigned char *glyph = (unsigned char *)&font + (ch < FONT_NUMGLYPHS ? ch : 0) * FONT_BPG;

    for (int i = 1; i <= (FONT_HEIGHT * zoom); i++)
    {
        for (int j = 0; j < (FONT_WIDTH * zoom); j++)
        {
            unsigned char mask = 1 << (j / zoom);
            if (*glyph & mask)
            { // only draw pixels belong to the character glyph
                drawPixelARGB32(x + j, y + i, attr);
            }
        }
        glyph += (i % zoom) ? 0 : FONT_BPL;
    }
}

// Top_Center,Top_Right,TopLeft,Center,Bottom_Center,Bottom_Right,Bottom_Left
void drawString(int x, int y, char *str, unsigned int attr, int zoom)
{
    while (*str)
    {
        if (*str == '\r')
        {
            x = 0;
        }
        else if (*str == '\n')
        {
            x = 0;
            y += (FONT_HEIGHT * zoom);
        }
        else
        {
            drawChar(*str, x, y, attr, zoom);
            x += (FONT_WIDTH * zoom);
        }
        str++;
    }
}

